import "./ExpensesList.css";
import React from "react";
const ExpensesList = (props) => {
  if (filteredExpenses.length > 0) {
    expensesContent = filteredExpenses.map((expense) => (
      <ExpenseItem
        key={expense.id}
        title={expense.title}
        date={expense.date}
        amount={expense.amount}
      />
    ));
  }
  return;
};
export default ExpensesList;
